var OrientationModes = {
  DIRECTION: 0,
  ROTATION: 1,
  MATRIX: 2
};
var ScaleModes = {
  SCALE_BY_CONSTANT: 0,
  SCALE_BY_MAGNITUDE: 1,
  SCALE_BY_COMPONENTS: 2
};
var Constants = {
  OrientationModes: OrientationModes,
  ScaleModes: ScaleModes
};

export { OrientationModes, ScaleModes, Constants as default };
